// src/components/InfoCard.jsx

import React from 'react';
import './InfoCard.css';

const InfoCard = ({ title, image, description, onClick }) => {
  return (
    <div className="info-card" onClick={onClick}>
      <h2>{title}</h2>
      <img src={image} alt={title} />
      <p>{description}</p>
    </div>
  );
};

export default InfoCard;
